def removeweirdquotes(n:String) = {
    try{
        var g = n
        if(n.takeRight(1).equals("\"")){
            g = g.dropRight(1)
        }
        if(n(0).equals('\"')){
            g = g.drop(1)
        }
        g
    }
    catch{
        case _ => n
    }
}

